import React from "react";
import styles from "../styles/loading.css";

export default function Loading() {
    return (
        <div className={styles.loading}>
            <img
                src={require("../assets/images/loading-buffering.gif")}
                alt="loading"
            />
            <span>Carregando...</span>
        </div>
    );
}
